import React from "react";
import { motion } from "framer-motion";

export default function PatientDetails() {
  const patient = {
    name: "John Doe",
    age: 29,
    gender: "Male",
    bloodGroup: "O+",
    familyDoctor: "Dr. Watson",
    profilePhoto: "https://i.pravatar.cc/150?img=20",
  };

  return (
    <div className="p-8 min-h-screen bg-gray-100">
      <motion.div
        initial={{ opacity: 0, y: -30 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
        className="max-w-3xl mx-auto bg-white shadow-2xl rounded-lg p-8"
      >
        <div className="flex items-center space-x-6">
          <img
            src={patient.profilePhoto}
            alt={patient.name}
            className="w-24 h-24 rounded-full shadow-md"
          />
          <div>
            <h2 className="text-2xl font-bold text-red-700">{patient.name}</h2>
            <p className="text-gray-600">Family Doctor: {patient.familyDoctor}</p>
          </div>
        </div>

        <div className="mt-6 grid grid-cols-2 gap-4">
          <p><strong>Age:</strong> {patient.age}</p>
          <p><strong>Gender:</strong> {patient.gender}</p>
          <p><strong>Blood Group:</strong> {patient.bloodGroup}</p>
        </div>
      </motion.div>
    </div>
  );
}
